2016- Here is when I found out about Ankira and when Syoko’s lim SSR came out I decided to Produce her too since she looked interesting!

2017 - This is the time when I started really knowing more characters and looking into them so I started Producing a lot of girls! This is also when I started joining the fanbase with this account and I got to know so many more characters that way :D

2018 - Here my tastes started settling more and while I don’t Produce Akane, Tokiko or Kako any more I still really like them to this day!

2019 - This is the time when the new girls came out and I fell in love with Chitose and Chiyo so much! I love my vampire gf Chitose so much.

2020 - Welcome Natalia to the Producer club! After finding out Teruki was going to voice Natalia I immediately took a liking to her because I love Futaba from Revue Starlight. When her lim SSR came out I decided to Produce her since some friends convinced me to :D

And that’s it! I wonder if my tastes will change in 2021 of if they’ll stay the same :0

